import logo4 from "../HowCanHelp/foster1.webp"
import logo5 from "../HowCanHelp/donate1.png"
import logo6 from "../HowCanHelp/tekit.png"
*/
//function
const HelpHomee=(props)=>{
    return(
        <section className="sec-how-can-help">
        <div className="con-how-can-help">
            <div className="item-how-can-help">
                <a href="..//page 6/volunter.html"><img className="sss" src="../images/hands.png" alt=""/></a>
                <h4><strong>Volunteer</strong></h4>
                <p>Currently seeking highly experienced large dog handlers at all Care Center locations</p>
            </div>
        </div>
    </section>
    )
}
export default HelpHomee;
